import React from "react";
import "./Choise.css";

const Choise = (props) => {
  const update_selected_tool = () => {
    let select_bar = document.querySelector("select");
    props.update_selected_tool(select_bar.value);
    props.rendOnOf(1);
  };
  return (
    <div>
      <select
        class="choise"
        default="Select Tool"
        onChange={update_selected_tool}
      >
        <option value="" disabled="disabled" selected="selected">
          Please select tool
        </option>
        <option value="0">GTO</option>
        <option value="1">GTA</option>
        <option value="2">GTT</option>
        <option value="3">GTX</option>
        <option value="4">ONT</option>
        <option value="5">ANT</option>
        <option value="6">GNT</option>
        <option value="7">OXS</option>
      </select>
    </div>
  );
};

export default Choise;
